INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('3560070475742', 'Lait frais entier bio', 'www.iplc.fr Ce lait provient de Carrefour vaches élevées dans le respect des cycles naturels et du bien être animal propre à l\'agriculture biologique doété microfiltré afin de préserver ses bienfaits et sa saveur. Les traitements de pasteurisation ont été remplacés (sauf pour la crème) par un oassage à travers des filtres très fins. Ceprocédé conserve les qualités gustatives du lait cru et garantit sa conservation car les bactéries et BI Can Laith ENT Microli pour préser impuretés ont été retenues par les filtres Lait frais microfiltré entier non standardisé issu de l\'agriculture biologique. Origine Ce lait Carrefour bio provient d\'élevages de Vaches laitières français. Il a été microfiltré et conditionné dans le département de la Loire (42). Conservation Le lait frais se conserve au froid entre 0°C et +6°C et est', 'https://static.openfoodfacts.org/images/products/356/007/047/5742/front_fr.3.400.jpg', '4', '2.3', '4.8', '4.8', '0', '3.2', '0.1', '0.0393700787401575', '', '1');

