VALUES ('3560070476022', 'Assortiment de chocolats sans alcool', 'Sucre, beurre de cacao, pâte de cacao, graisses végétales (palmiste, palme), lait entier en poudre, pâte de noisettes, caramel (sirop de glucose, lait concentré sucré, graisse de palme, sucre, dextrose, émulsifiants : lécithines (tournesol) et mono - et diglycérides d\'acides gras, beurre concentré, sel, arôme),  cacao maigre en poudre, lactose,  pâte d\'amandes, lait écrémé en poudre, lactosérum en poudre, sirop de glucose, matière grasse de lait anhydre, huile de tournesol, émulsifiant : lécithines (tournesol), éclats de noisettes torréfiées, grains de céréales extrudées (farine de blé, sucre, farine de blé malté, amidon de blé, extrait de malt d\'orge, lait écrémé en poudre, sel, arôme), noix de coco râpée caramélisée (noix de coco râpée, sucre), stabilisant : glycérol, café, arômes, grains de céréales extrudées (farine de riz, farine de blé, sucre, extrait de malt d\'orge, sel), framboise, épaississants : pectines et farine de graines de caroube, acidifiant : acide citrique, jus de sureau concentré Peut contenir des traces d\'œufs et d\'autres fruits à coque. Origine : Ces bonbons de chocolat ont été fabriqués en France à partir d\'ingrédients de diverses origine. Contient 24,8% d\'enrobage chocolat au lait, 15,3% d\'enrobage chocolat noir et 6,1% d\'enrobage chocolat blanc.', 'https://static.openfoodfacts.org/images/products/356/007/047/6022/front_fr.16.400.jpg', '35', '19', '51', '49', '3.1', '5.8', '0.1', '0.0393700787401575', '', '0');

