VALUES ('3560070487486', 'Panés de dinde et de poulet Bolognaise', 'Ingrédients (à la mise en oeuvre) : eau, préparation de viande de dinde 22,5%, préparation de viande de poulet 16,6%, farine de _blé_, préparation à base de tomates concentrées 6,5% (tomates, acidifiant : E330), viande de boeuf 2,75%, purée de tomates double concentrée 1,7%, gélatine de boeuf, dextrose, fibres de _blé_, purée de carotte, peau de poulet, amidon modifié, sel, huile de tournesol, oignons rissolés (oignons, huile de tournesol, sucre, arômes naturels, flocons de pomme de terre, sel), arômes naturels, sucre, antioxydant : E331, levure, protéines de _blé_, extrait de vin blanc, épices, herbe aromatique, arôme,arôme de fumée, conservateurs : E202 et E250. Huile de tournesol. Les pourcentages sont exprimés sur le produit total avant friture. Peut contenir des traces d\'oeuf, lait, céleri. Ce produit est fabriqué à partir de viande de volaille origine UE et de viande bovine origine France.', 'https://static.openfoodfacts.org/images/products/356/007/048/7486/front_fr.16.400.jpg', '11', '2.7', '15', '2.3', '', '11', '1.2', '0.47244094488189', '', '0');

